import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import './App.css';

// Example pages for different departments
function SSC() {
  return <h2>SSC - Staff Selection Commission Question Papers</h2>;
}

function RRB() {
  return <h2>RRB - Indian Railway Question Papers</h2>;
}

function IBPS() {
  return <h2>IBPS Question Papers</h2>;
}

function UPSCCMS() {
  return <h2>UPSC CMS - Combined Medical Services Question Papers</h2>;
}

function NEETPG() {
  return <h2>NEET PG Question Papers</h2>;
}

// More components can be added similarly for other links...

function App() {
  return (
    <Router>
      <div className="App">
        <h1>Central and State Government Question and Answers</h1>
        <table id="joblist">
          <thead>
            <tr>
              <th colSpan="5" className="post_header">Previous Year Question Papers</th>
            </tr>
            <tr>
              <th>DEPT</th>
              <th>LINK</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>SSC - Staff Selection Commission</td>
              <td><Link to="/ssc">Link</Link></td>
            </tr>
            <tr>
              <td>RRB - Indian Railway</td>
              <td><Link to="/rrb">Link</Link></td>
            </tr>
            <tr>
              <td>IBPS</td>
              <td><Link to="/ibps">Link</Link></td>
            </tr>
            <tr>
              <td>UPSC CMS- Combined Medical Services</td>
              <td><Link to="/upsc-cms">Link</Link></td>
            </tr>
            <tr>
              <td>NEET PG</td>
              <td><Link to="/neet-pg">Link</Link></td>
            </tr>
            {/* Add more rows as needed */}
          </tbody>
        </table>

        {/* Define Routes */}
        <Routes>
          <Route path="/ssc" element={<SSC />} />
          <Route path="/rrb" element={<RRB />} />
          <Route path="/ibps" element={<IBPS />} />
          <Route path="/upsc-cms" element={<UPSCCMS />} />
          <Route path="/neet-pg" element={<NEETPG />} />
          {/* Add more routes for other links */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
